import React from 'react';
import Spline from '@splinetool/react-spline/next';

export default function Home() {
  return (
    <div style={{ position: 'relative', height: '100vh', overflow: 'hidden' }}>
      {/* Background Spline */}
      <Spline
        scene="https://prod.spline.design/3z9PPkKZWxSG4JeS/scene.splinecode"
        style={{
          position: 'absolute',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          zIndex: -1
        }}
      />

      {/* Content */}
      <h1 style={{ position: 'relative', color: '#000', textAlign: 'center', marginTop: '20%', zIndex: 1 }}>
        Welcome to UniFix!
      </h1>
    </div>
  );
}
